import React from 'react'
import classes from './GlobalSheet.module.scss'

const Global = (data) => {
    let pasreData = null;
    data().then((data) => {
     pasreData = data;
    });

    console.log(pasreData);
    return (
        <div className={classes.sheet__wrapper}>
            <table>
                <thead>
                    <td>Global cases!</td>
                </thead>
                <tbody>
                    <td>{pasreData.cases}</td>
                </tbody>
            </table>
        </div>
    );
};
  
export default Global;
